(4605, 25, 547, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio Diagnóstico: Floating</title>\n    <style>\n      *{\n          margin: 0;\n          padding:0;\n      }\n\n      .clearfix:after {\n           visibility: hidden;\n           display: block;\n           font-size: 0;\n           content: " ";\n           clear: both;\n           height: 0;\n           }\n      .clearfix { display: inline-block; }\n      * html .clearfix { height: 1%; }\n      .clearfix { display: block; }\n      \n      .caja {\n          width: 200px;\n          height: 200px;\n          margin: 0 20px 0 0;\n      	  float: right;\n      }\n\n      .container { background-color: purple; }\n\n      .rojo{ background-color: red }\n\n      .amarillo{ background-color: yellow; }\n\n      .azul{ background-color: blue; }\n    </style>\n</head>\n<body>\n	<div class="container clearfix">\n		<div class="caja rojo"></div>\n		<div class="caja amarillo"></div>\n		<div class="caja azul"></div>\n	</div>\n</body', '2016-01-11 10:49:17', '2016-01-11 10:49:29', 10),
(4606, 26, 547, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Condicionales</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n            var nombre = prompt("Hola escribe aquí tu nombre");\n\n            if ( nombre != null ) {\n            alert("Hola " + nombre + ", ahora dinos tu edad" );\n\n            var edad = prompt("Hola, escribe aquí tu edad");\n            }\n            else {\n                prompt("No escribiste tu nombre :( Inténtalo de nuevo");\n            }\n\n            if ( edad > 18 ) {\n                alert("Eres mayor de edad!");\n            }\n            else {\n                alert("Eres una niña!");\n            }\n            });\n    });\n  </script>\n</body>\n</html>', '2016-01-11 10:49:30', '2016-01-11 11:25:11', 50),
(4607, 27, 547, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Repetitivas</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n            var counter;\n\n            for (counter = 0; counter <= 5; counter++) { \n                console.log(counter);\n                if (counter == 5) {\n                alert(''BOOOM'');\n                }\n            }\n    	});\n    });\n  </script>\n</body>\n</html>', '2016-01-11 11:06:50', '2016-01-11 11:37:04', 30);
