(5925, 20, 240, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Display</title>\n	<style>\n      * {\n          margin:0;\n          padding: 0;\n          box-sizing: border-box;\n      }\n      .elementos-inline {\n		color: white;\n	  }\n      \n      .elementos-block {\n          margin:20px 0;\n          text-align: center;\n      }      \n      .block{\n			display: block;\n		}\n      .inline-block{\n			display: inline-block;\n		}\n      /*Inserta aqui tus estilos */\n      .block-1{\n      	background-color: red; \n      	width: 50px; \n      	height: 30px;\n      }\n      .block-2{\n      	background-color: green; \n      	width: 150px; \n      	height: 30px; \n      	border: 1px solid black;\n      }\n    </style>\n</head>\n<body>\n	<div class="elementos-inline">\n		<!-- Inserta tu código para elementos inline aqui-->\n     	 <div class="inline-block block-1"></div>\n      	<div class="inline-block block-1"></div> \n      	<div class="inline-block block-1"></div> \n	</div>\n\n	<div class="elementos-block">\n		<!-- Inserta tu código para elementos block aqui-->\n      <div class="inline-block block-2"></div> \n      <div class="inline-block block-2"></div>\n      <div class="inline-block block-2"></div>\n      <div class="inline-block block-2"></div>\n      <div class="inline-block block-2"></div>\n	</div>\n</body>\n</html>', '2016-01-15 20:54:33', '2016-01-18 06:11:07', 20),
