(39, 'Ejercicio: Viendo Cajas', 8, '2016-01-14 12:50:06', '2016-03-10 08:09:08', 'exercise', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'viendo-cajas.zip', 'application/x-zip-compressed', 12216, '2016-01-14 12:50:06', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n 5. Dentro del ZIP encontrarán una imagen y un archivo index.html \r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen.\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/viendo-cajas-2.png', 1, '', 'viendocajas.zip', 'application/octet-stream', 12832, '2016-02-23 21:41:53', 0, 0, 0, NULL),
(40, 'Ejercicio: Lenguajes de la Web', 8, '2016-01-14 13:10:33', '2016-03-10 08:09:21', 'exercise', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'lenguajes-web-1.zip', 'application/x-zip-compressed', 39398, '2016-01-14 13:10:33', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la creo no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Lenguajes de la Web\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Lenguajes de la web).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Dentro del ZIP encontrarán una carpeta de img, un .ico y un file index.html\r\n\r\n**Parte 1**\r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen\r\n\r\n**Parte 2**\r\n\r\nUna vez que la estructura HTML está lista realice los siguientes cambios:\r\n\r\nPara el título cambie los siguientes elementos:\r\n\r\n - color: red \r\n - peso de la letra: 500\r\n -  letra: Arial\r\n - tamaño de letra: 20px\r\n\r\nPara cada lenguaje:\r\n\r\n - Que la imagen tenga un borde (color: blue, de 1px y sólido)\r\n - Que el párrafo sea (color: yellow, tamaño de letra 14px)\r\n\r\nPara el h2 sea:\r\n\r\n - color: black\r\n - tamaño de letra 16px\r\n\r\n**Parte 3**\r\n\r\nTraslada todos los estilos de la página del “Lenguajes de la web” al <head>\r\n\r\n**Parte 4**\r\n\r\nTraslada todos los estilos de la página del “Lenguajes de la web” a un nuevo archivo css (main.css) y conecta el HTML con el CSS\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/lenguajes-web-2.png', 1, '', 'lenguajes-web.zip', 'application/octet-stream', 162492, '2016-02-23 21:42:42', 0, 0, 0, NULL),
