(48, 'Ejercicio: Márgenes automáticos', 9, '2016-01-15 07:45:51', '2016-03-10 08:10:42', 'exercise', 8, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'margin-automatico.zip', 'application/x-zip-compressed', 870, '2016-01-15 07:45:51', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (En caso ya exista no realizar este paso)\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Márgenes automáticos.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Márgenes automáticos).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n\r\nReproduce en HTML y CSS la imagen que se ve más abajo:\r\n\r\n![Margin Automático][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/margen-automatico.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 7096, '2016-02-05 17:07:00', 0, 0, 0, NULL);
