(49, 'Blog Post: Git  Básico Parte I', 6, '2016-01-15 15:48:32', '2016-01-21 16:44:46', 'html', 2, '', '<style>\r\n  .git-basico p {\r\n  	margin: 0 0 20px;\r\n  }\r\n  .git-basico h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n</style>\r\n<div class="container git-basico">\r\n\r\n<h1>Introducción</h1>\r\n<p>Ahora que ya conocemos cómo funciona la línea de comandos y lo que es una terminal, empecemos a mirar el flujo de trabajo con los comandos que vienen con git.</p>\r\n\r\n<p>Git es un sistema de control de versiones que nació con la finalidad de resolver las deficiencias de SVN (un sistema de control versiones más antiguo). Los sistema de control de versiones tienen como finalidad guardar todas las versiones de un archivo (en este caso de nuestro código) de tal manera que no se pierda ningún cambio que se haga al código.</p>\r\n\r\n<p>Muchos equipos que desarrollan software utilizan los sistema de versiones de controles para mejorar el flujo de trabajo pues estos permite centralizar todo el código que desarrolla el equipo en un sólo lugar y hace que la colaboración sea mucho más sencilla de realizar. </p>\r\n  \r\n<h2>¿Qué es un Repositorio?</h2> \r\n\r\n<p>Pensemos que un repositorio es un lugar donde ponemos nuestro código y los cambios que vayamos haciendo mientras desarrollamos nuestro proyecto. De esta manera, si tenemos algún error que querramos corregir o querramos hacer algún cambio desde un punto específico del desarrollo tenemos un lugar donde se encuentra todo nuestro historial.</p>\r\n  \r\n  <p>Existen dos tipos de repositorios: </p>\r\n  \r\n  <p><strong>Local:</strong> Repositorio que se crea en nuestra computadora y no necesitamos una conexión a internet para acceder a él y donde podemos hacer todos los cambios a nuestro proyecto</p>\r\n  \r\n  <p><strong>Alojado ( hosting ):</strong> Repositorio en la nube que tiene una copia de tus archivos locales. El repositorio remoto con el local deben estar vinculados (<kbd>git remote add origin ....</kbd>) para poder replicar los cambios realizados en el repositorio local en el repositorio remoto. Los servicios más conocidos para tener alojado tu código son Bitbucket y Github.</p>\r\n  \r\n  <p>Te recomiendo que ya debes de tener una cuenta en alguno de ellos antes de seguir leyendo este post y si no lo tienes, crearte una.</p>\r\n\r\n<h2>Configuración previa a usar Git</h2>\r\n  \r\n<p>Ahora que ya tenemos Git instalado, debemos identificarnos. Para hacer esto, debes correr los siguientes comandos:</p>\r\n\r\n<kbd>git config --global user.name tu-nombre</kbd><br>\r\n<kbd>git config --global user.email tu-email</kbd><br><br>\r\n  \r\n<p>Este comando está grabando nuestra información personal en la configuración global de git, lo que permite que otros comandos utilicen esta información global para identificar quien está realizando el comando.</p>\r\n<p>No te preocupes, sólo necesitas hacer esto una sóla vez y te servirá para no darte problemas al momento de subir tu proyecto a tu repositorio de alojamiento. </p>\r\n  \r\n<div class="example-gif"><img src="http://i.imgur.com/oH2DiBX.gif" alt="git-config-gif"></div> <br/>\r\n\r\n<p>Para poder manejar Git correctamente, tenemos que conocer lo que es un repositorio.</p>\r\n  \r\n<h2>Creando un repositorio local</h2>  \r\n  \r\n  <p>En nuestra terminal, asegurémonos de estar dentro de nuestra carpeta del proyecto con el que vamos a usar git y corramos el comando: <kbd>git init</kbd>, tal y como lo ven en el ejemplo de abajo</p>\r\n  \r\n   <div class="example-gif"><img src="http://i.imgur.com/FIOuG4D.gif" alt="git-init-gif"></div> <br/><br/>\r\n  \r\n  <p>Luego de correr este comando vemos que aparece un mensaje en inglés que nos dice que se ha creado con satisfacción un repositorio en nuestro proyecto.</p>\r\n  \r\n  <p>Una vez que tenemos nuestro repositorio local creado vamos a ver ver los comandos básicos que son parte del flujo de trabajo con Git.</p>\r\n<h2>Agregando archivos a mi repositorio local</h2>\r\n	<br>\r\n  <p><kbd>git add .</kbd></p>\r\n  <p>Este comando pondrá en la mira de git a nuestros archivos del proyecto. Podríamos utilizar <kbd>git add .</kbd> siendo el punto la forma de decir que queremos agregar todos los archivos o podríamos correr <kbd>git add nombre-del-archivo</kbd> si quisieramos agregar sólo una parte de lo que está en nuestra carpeta del proyecto. </p>\r\n<p>Veamos estas dos maneras en el ejemplo</p>\r\n\r\n<div class="example-gif"><img src="http://i.imgur.com/O4k9bR9.gif" alt="git-init-gif"></div> <br/><br/>\r\n  \r\n  <h2>¿Cómo obtener información de mi repositorio local?</h2>\r\n     <br><p><kbd>git status</kbd></p>\r\n  <p>Este comando contiene la información sobre el estado de nuestros archivos y directorios que vayamos a tener en nuestro git. Esa información incluye decirnos si hemos hecho algún cambio en algún archivo o si hay algún archivo que no está dentro del nuestro flujo de versionamiento. Veamos como se ve en nuestro ejemplo</p>\r\n  \r\n  <div class="example-gif"><img src="http://i.imgur.com/w0FNEn6.gif" alt="git-status-gif"></div> <br/><br/>\r\n  \r\n  <p>Como vemos en nuestro ejemplo, hemos corrido el comando y vemos que todos nuestros archivos están rojos, esto quiere decir que git está reconociendo que hay archivos dentro de la carpeta del proyecto pero que no son parte árbol de versionamiento (?) para agregarlos al repositorio de git veamos el siguiente comando:\r\n</p>\r\n    \r\n  <h2>Comiteando los archivos locales</h2>\r\n  <br>\r\n  <p><kbd>git commit -m "escribe aquí una descripción de tu primer commit"</kbd></p>\r\n  <p>Luego que ya tenemos los archivos que queremos en la mira de git, nos toca grabar los cambios que hemos hecho hasta ahora, que en este caso vendría a ser el agregar nuestros archivos al árbol. La forma usual de correr este comando es <kbd>git commit -m "escribe aquí una descripción de tu primer commit"</kbd> donde -m es la opción que te permite escribir un mensaje.</p><br>\r\n  <p>Mira el ejemplo</p>\r\n  \r\n  <div class="example-gif"><img src="http://i.imgur.com/u52vOTr.gif" alt="git-init-gif"></div> <br/><br/>\r\n    \r\n    <p>Puedes específicar todo lo que desees en tus mensajes de commits.</p>\r\n    \r\n    <h2>A continuación</h2>\r\n    <p>Si has llegado satisfactoriamente hasta este punto, tu siguiente paso es ir a tu cuenta de Github o Bitbucket y crear ahí un repositorio, para más detalles de como hacerlo, <a href="http://seleccion.laboratoria.la/admin/courses/3/units/6/pages/60">ve a la segunda parte del post</a>¡No te lo pierdas!</p>\r\n  \r\n</div>\r\n', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
