(54, 'Ejercicio: Floatings', 10, '2016-01-15 22:28:07', '2016-03-10 08:11:23', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'floating.zip', 'application/x-zip-compressed', 312, '2016-01-15 22:28:07', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (En caso ya exista no realizar este paso)\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Floatings\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Floatings).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n\r\n**Parte 1**\r\n\r\nRecrea esta imagen:\r\n\r\n![Float 1][1]\r\n\r\n 1. Cambia el floating de los bloques a left. ¿Qué paso?\r\n 2. Cambia el floating a right. ¿Qué pasó ahora?\r\n 3. Te diste cuenta que el borde que los contenía colapso a una sola rayita? Ahora arreglalo… (Tip: busca sobre clearfix)\r\n\r\nAsi debe quedar:\r\n\r\n![Float 2][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/float1.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/float4.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 3405, '2016-02-05 18:25:34', 0, 0, 0, NULL),
