(58, 'Ejercicio: Nuestras coders', 10, '2016-01-16 18:08:52', '2016-03-10 08:11:53', 'exercise', 9, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'coders.zip', 'application/x-zip-compressed', 441885, '2016-01-18 18:01:36', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Nuestras coders\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Nuestras coders).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n![Nuestras coders][1]\r\n.\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/coders.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 443068, '2016-02-05 20:32:05', 0, 0, 0, NULL),
(59, 'Ejercicio: La cancha', 10, '2016-01-16 18:11:19', '2016-03-10 08:12:05', 'exercise', 10, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'cancha.zip', 'application/x-zip-compressed', 2233, '2016-01-16 18:11:19', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Nuestras coders\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Nuestras coders).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Abre el file index.html y recrea el website que se muestra a continuación.\r\n\r\n![La cancha][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/lacancha.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 3004, '2016-02-05 20:53:55', 0, 0, 0, NULL),
(60, 'Blog Post: Git Básico Parte II', 6, '2016-01-18 00:12:39', '2016-01-25 15:39:04', 'html', 3, '', '<div class="container">\r\n  <h1>Crear un Respositorio en Github</h1>\r\n  \r\n  <p>Como les conté en el post anterior, luego de crear nuestro primer commit, el siguiente paso es crear un repositorio nuevo en Github. Recordar que previamente debemos crearnos una cuenta en <a href="http://www.github.com" target="_blank">http://www.github.com </a>.</p>\r\n\r\n<p>Una vez que creaste tu repositorio de alojamiento, dependiendo de en que servicio tengas tu cuenta, te saldrá una imagen como esta</p>\r\n  \r\n  <div class="example-img"><img src="http://i.imgur.com/sEExHgn.jpg"></div> <br/><br/>\r\n\r\n<p>En mi caso, yo tengo una cuenta en Github así que ahí creé mi repositorio. Como vemos, hay una serie de instrucciones que hay que seguir. Como yo ya llegué hasta la parte donde hice mi primer commit lo siguiente que me toca es correr el comando <kbd>git remote add origin url-del-repositorio</kbd> y consecutivamente <kbd>git push origin master</kbd>. Veamos el ejemplo.</p>\r\n    \r\n     <div class="example-img"><img src="http://i.imgur.com/JJf1wKi.gif"></div> <br/><br/>\r\n       \r\n       <p>Como vemos en el ejemplo, con el primer comando hemos hecho la conexión entre mi repositorio local y mi repositorio que cree en Github y con el siguiente he hecho la subida de mis archivos y sus commits. El primer comando sólo se debe de correr una vez ya que sólo es para establecer la conexión de la que hablé al comienzo y a partir de aquí se realizará el mismo flujo cada vez que creamos conveniente.</p>\r\n       \r\n       <h3>Flujo</h3>\r\n       \r\n       <ul>\r\n         <li><kbd>git status</kbd></li>\r\n         <li><kbd>git add</kbd></li>\r\n         <li><kbd>git commit</kbd></li>\r\n         <li><kbd>git push origin master</kbd></li>\r\n       </ul>\r\n	\r\n       <h3>Sigamos con mi ejemplo</h3>\r\n\r\n      \r\n       <div class="example-img"><img src="http://i.imgur.com/XNJ0nKd.gif"></div> <br/><br/>\r\n\r\n         <h2>¿Que sigue?</h2>\r\n         <p>Si has llegado satisfactoriamente hasta este punto, ya tienes la base para tus repositorios para tus futuros proyectos. Pero Git es mucho más. Muy pronto encontrarás temas mucho más avanzados para que sigas aprendiendo!</p>', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
