(71, 'Blog Post: Uso de la terminal', 12, '2016-01-19 22:22:41', '2016-01-20 23:50:12', 'html', 1, '', '<style>\r\n  .terminal-basico p {\r\n  	margin: 0 0 20px;\r\n  }\r\n  .terminal-basico h1 {\r\n  	margin-bottom: 20px;\r\n  }\r\n  \r\n  .terminal-basico ul {\r\n  	margin-left: 20px;\r\n    list-style: disc;\r\n  }\r\n  \r\n  .terminal-basico ul li {\r\n    list-style: disc;\r\n  }\r\n  \r\n  .terminal-basico img {\r\n  	width: 100%;\r\n  }\r\n</style>\r\n<div class="container terminal-basico">\r\n  <br>\r\n  <h1>Introducción</h1>\r\n  <p>La terminal es un programa de computadora cuya interfaz sirve para darle instrucciones a la computadora. Así como nosotros utilizamos a los lenguajes de programación para la creación y mantenimiento de un programa a través de instrucciones ( desde el código que escribimos ), el mismo concepto se aplica para nuestras computadoras. La diferencia es que en vez de usar un lenguaje de programación ( javascript, ruby, python, etc ) se nos brinda un grupo de comandos que van desde navegar por nuestras carpetas hasta enviar emails o iniciar servidores.</p>\r\n  <p>En este post vamos a ver desde la instalación de Git Bash ( que vendría a ser la terminal para Windows) hasta los comandos más básicos pero no menos necesarios e importante, de la terminal.</p>\r\n    <h1>Instalación de Git Bash</h1>\r\n    <p>Git bash es un programa de computadora que emula a la terminal de un sistema operativo Linux, y definitivamente es una mejora radical sobre la terminal original de windows. Para poder usar git bash vamos a tener que aprender algunos comandos básicos para poder navegar entre las carpetas y algunos comandos git que nos permitirán luego interactuar con nuestro repositorio de datos.\r\n</p>\r\n    <p>Para instalar Git bash sigue las siguientes instrucciones:</p>\r\n    <ul>\r\n      <li>Ingresa a esta url: <a href="https://git-for-windows.github.io/">https://git-for-windows.github.io/</a></li>\r\n      <li>Da click al botón de download ( descargar en inglés )</li>\r\n      <li>Luego sigue los pasos que se encuentran en la siguiente imagen</li>\r\n    </ul>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/instalacion-git.png"/>\r\n    \r\n    <h1>Comandos [ pwd ]</h1>\r\n    <p>Este comando es el diminutivo de la frase "path within directory" ( ruta del directorio en español ). Funciona para que podamos saber en qué ruta nos encontramos actualmente y de esta manera seamos capaces de navegar por nuestra computadora desde la terminal con el comando cd que lo vamos a ver más adelante.</p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/cdcomando.gif"/>\r\n    <h1>Comandos [ ls ]</h1>\r\n    <p>Dentro de la interfaz de git bash tipear el comando "ls" y presionar el botón Enter como en el gif de abajo. </p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls.gif"/>\r\n    <p>Como puedes observar han aparecido una lista de items, estos son las carpetas y archivos que se encuentran en el directorio en que te encuentras actualmente. También podemos correr ls -all para tener mayores detalles sobre los archivos y carpetas que están en nuestro directorio, a diferencia del comando pwd que sólo te muestra la ruta en la que se encuentra tu directorio en que estás.\r\n</p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls-all.gif"/>\r\n    <h1>Comandos [ cd ]</h1>\r\n    <p>El comando cd es el acrónimo de "change directory" ( cambiar de directorio en español ) y nos sirve para navegar por nuestra computadora desde la terminal. En el ejemplo de abajo, utilizo el comando pwd para mostrar la ruta actual y uso cd para ingresar a una carpeta y cd .. para salir de esa carpeta</p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/ls-all.gif"/>\r\n    <h1>Comandos [ mkdir ]</h1>\r\n    <p>El comando mkdir, cuyo significado viene de la frase "make directory" ( haz un directorio es español ), sirve para crear directorios o carpetas desde la terminal. Es el equivalente al proceso de hacer click derecho + nuevo + carpeta. Observa el ejemplo de abajo.\r\n</p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/mkdir.gif"/>\r\n    <h1>Comandos [ touch ]</h1>\r\n    <p>El comando touch nos sirve para modificar archivos y crear nuevos archivos vacíos en caso de que se escribiera el comando sin ninguna otra opción. Ver el ejemplo de abajo\r\n</p>\r\n    <img src="https://dl.dropboxusercontent.com/u/1621947/laboratoria/Posts/terminal/touch.gif"/>\r\n    <p>Con el conocimiento básico de estos comandos, podrás continuar  con el manejo de los comandos de Git.\r\n</p>\r\n</div>', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
