(75, 'Ejercicio: User Testing 360 ', 12, '2016-01-19 23:18:21', '2016-03-10 08:19:08', 'exercise', 8, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'problema.zip', 'application/x-zip-compressed', 3366230, '2016-01-25 17:28:30', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (En caso ya exista no realizar este paso)\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada User-Testing.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (User-Testing).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Dentro del ZIP que se encuentra en la sección de Descargas, existe una carpeta docs que contiene el diseño final del proyecto\r\n\r\n![User Testing 360][1]\r\n\r\n\r\n  [1]:https://dl.dropboxusercontent.com/u/1621947/laboratoria/user360.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(76, 'Ejercicio: Descubriendo los breakpoints', 12, '2016-01-19 23:38:06', '2016-03-10 08:18:16', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'colores.zip', 'application/x-zip-compressed', 515, '2016-01-24 17:50:10', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n\r\nSeguir las siguientes instrucciones para el ejercicio:\r\n\r\n 1. Insertar una imagen centrada y que se mantenga centrada y ajustada cuando se haga responsive\r\n 2. Utilizar los siguientes breakpoints y cambiar el color de fondo por cada rango de breakpoints\r\n\r\nBreakpoints: \r\n\r\n320px - 375px; GREEN\r\n\r\n376px - 667px; YELLOW\r\n\r\n667px - 1024px; RED\r\n\r\n1024px - 1600px; BLUE\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(77, 'Ejercicio: Responsive Blog', 12, '2016-01-19 23:38:33', '2016-03-10 08:18:41', 'exercise', 7, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'responsive-blog.zip', 'application/x-zip-compressed', 5217781, '2016-01-23 17:48:30', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Responsive Blog\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Responsive Blog).\r\n 5. Dentro del ZIP encontrarán una imagen y un archivo index.html \r\n\r\nCon los archivos proporcionados has que se vea igual que en la imagen\r\n\r\n![Responsive Blog][1]\r\n\r\n![Responsive blog - small][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/responsiveblog.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/vista-responsive.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
