(82, 'Ejercicio: Flat theme ', 13, '2016-01-20 05:29:30', '2016-03-10 08:19:56', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Flat_theme.zip', 'application/x-zip-compressed', 11876257, '2016-01-26 15:33:13', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Flat theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Flat theme).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Este ejercicio se trabajara de a 2 y para eso usaran Github para subir y bajar los cambios de sus compañeras usando el Gitbash.   \r\n\r\nAbre el file index.html y recrea el website que se muestra a continuación junto a tu compañera.\r\n\r\n![Flat Theme][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/flat-theme.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(83, 'Ejercicio: Landing Page y Breakpoints', 12, '2016-01-24 17:59:20', '2016-03-10 08:18:30', 'exercise', 6, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'landing.zip', 'application/zip', 199996, '2016-02-22 20:21:13', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n 5. Dentro del ZIP encontrarán una imagen y un archivo index.html \r\n\r\nCon los archivos proporcionados crear la estructura HTML necesaria para que se vea igual que en la imagen.\r\n\r\n![landing][1]\r\n\r\nResponsive:\r\n\r\n![Responsive design][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/backyard.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/backyard-responsive.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(84, 'Introducción a SASS ', 14, '2016-01-26 21:20:35', '2016-01-27 17:45:14', 'slides', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, 'https://docs.google.com/presentation/d/1OsKOv9v6a2IQL_3VTqrMC6sTg0I_qpyYwmcHOL5ZGKI/embed?start=false&loop=false&delayms=3000', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(85, 'Ejercicio: Empezar a usar SASS - Backyard Theme', 14, '2016-01-26 21:21:46', '2016-03-10 08:20:13', 'exercise', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Backyard-Theme.zip', 'application/zip', 1111019, '2016-01-29 16:29:22', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Backyard Theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Backyard Theme).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Instalar Sass de acuerdo a los pasos explicados en clase y los slides.\r\n 6. Crea tu archivo **main.scss**, que usarás para armar el landing, dentro de la carpeta **CSS**\r\n 7. Investigar en la [Documentación de SASS][1] o en donde encuentres información sobre lo siguiente:\r\n - Como hacer para que ese **main.scss** genere un main.css para el navegador ( pre-compilación sass )\r\n - Como hacer para que SASS siempre esté pendiente de los cambios que se hagan en el main.scss y se actualice automáticamente en el main.css  ( sass watch )\r\n\r\nAbre tu app.html y comienza a replicar el landing que ves a continuación. \r\n\r\n![enter image description here][2]\r\n\r\n\r\n  [1]: http://sass-lang.com/documentation/file.SASS_REFERENCE.html\r\n  [2]: http://i.imgur.com/azo0BLI.jpg', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(86, 'SASS - Ejercicio Nesting y Variables - Triangle Theme', 14, '2016-01-26 21:23:03', '2016-03-10 08:20:23', 'exercise', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Triangle-Theme.zip', 'application/zip', 1592948, '2016-02-04 15:50:12', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Triangle Theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Triangle Theme).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. En la carpeta encontrarás un landing con código incompleto. Utilizando ese código que se encuentra en **index.html** y **main.css** debes hacer lo siguientes:\r\n    Armar el código en SASS  utilizando todo lo que se aprendió en las clases y los slides ( no basta con crear el archivo y copiar el código )\r\n    Continuar armando el landing hasta que se quede como en la imagen a continuación \r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: http://i.imgur.com/5OY3Elo.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(87, 'SASS - Ejercicio Extends y Mixins - Kane Theme y Paleta de Colores', 14, '2016-01-26 21:23:43', '2016-03-14 16:45:30', 'exercise', 4, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'kane.zip', 'application/octet-stream', 1060179, '2016-03-14 16:45:30', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Kane Theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Kane Theme).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Crear la paleta de colores utilizando **SOLO** mixins.\r\n 6. Armar el landing utilizando todo lo aprendido de Sass\r\n 7. Abrir el index.html y comienza a replicar el landing según la imagen que ves a continuación\r\n\r\n    ![enter image description here][1]\r\n\r\n\r\n  [1]: http://i.imgur.com/2AppIkw.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
