(91, 'Ejercicio: Arrancando con Jade', 14, '2016-01-26 22:15:52', '2016-03-10 08:21:02', 'exercise', 8, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Future-Imperfect.zip', 'application/x-zip-compressed', 4460785, '2016-02-26 17:25:52', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Future Imperfect\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Future Imperfect).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Instalar Jade de acuerdo a los pasos explicados en clase y los slides.\r\n 6. Crea tu archivo **index.jade**, que usarás para armar el landing, dentro de la carpeta **jade**\r\n 7. Investigar en la Documentación de Jade o en donde encuentres información sobre lo siguiente:\r\n\r\nComo hacer para que ese **index.jade** genere un **index.html** para el navegador y que ese **index.html** se encuentre en la raíz del directorio de tu proyecto ( pre-compilación jade )\r\nComo hacer para que Jade siempre esté pendiente de los cambios que se hagan en el **index.jade** y se actualice automáticamente en el **index.html** ( jade watch )\r\n\r\n 8. Comienza a crear el landing que ves a continuación usando Jade y Sass.\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: http://i.imgur.com/TA5YMBM.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(92, 'Jade Syntax Documentation', 14, '2016-01-26 22:20:15', '2016-01-26 23:01:30', 'html', 9, '', '<style>\r\n  .wrapper {\r\n  	height:100%;\r\n  }\r\n  .page {\r\n  	height: 88%;\r\n  }\r\n  .page .content {\r\n  	height: 100%;\r\n  }\r\n  .content .container-fluid {\r\n  	position: relative;\r\n    height:100%;\r\n  }\r\n  \r\n  iframe {\r\n  	position: absolute;\r\n  	width: 100%;\r\n  	height: 100%;\r\n  	border: none;\r\n  }\r\n</style>\r\n<iframe src="https://naltatis.github.io/jade-syntax-docs/"></iframe>', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(94, 'Ejercicio: Agency Theme', 14, '2016-01-26 23:03:48', '2016-03-10 08:21:13', 'exercise', 11, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Agency-Theme.zip', 'application/x-zip-compressed', 3047785, '2016-02-26 17:31:08', '\r\n### INSTRUCCIONES\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Agency Theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada ( Agency Theme ).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Usar lo aprendido acerca de Estructura de Plantillas con Jade para comenzar a maquetar el proyecto.\r\n\r\n![enter image description here][1]\r\n \r\n\r\n\r\n  [1]: http://i.imgur.com/DxWdi7z.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
