(102, 'Ejercicio: Dispensador de Productos', 19, '2016-01-27 15:44:03', '2016-03-10 08:21:30', 'exercise', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'expendedor.zip', 'application/octet-stream', 195959, '2016-02-11 22:26:34', '\r\n### INSTRUCCIONES\r\n\r\n“El expendedor” es un juego de 75 minutos para equipos a los que se explica por primera vez Scrum. Permite que hagan una simulación de creación de la lista de objetivos priorizada (Product backlog) y de ejecución del propio proceso de Scrum, de manera que comprueben cuáles son los principales beneficios de Scrum, especialmente los referidos a alineamiento con las expectativas del cliente, flexibilidad y retorno anticipado de inversión.\r\n\r\nEl juego también permite entender diversos conceptos que facilitan el desarrollo ágil: alcance variable, minimizar el número de objetivos en curso (WIP), integración continua de componentes, etc. \r\n\r\nPara ello, se incluye como factores de complejidad diversos cambios de objetivos durante el proyecto y un problema tecnológico.\r\nTodo ello construyendo un expendedor con papel, tijeras, cinta adhesiva y globos.\r\n\r\n### Contexto\r\nNuestro cliente, una gran marca deportiva, quiere lanzar un producto para deportes marinos inexistente en el mercado. Con el fin de dar una mayor imagen de innovación, este producto se venderá mediante un expendedor automático. **Nuestra visión será: Construir un expendedor automático de un producto deportivo.**\r\n\r\nLa duración del juego es de 75 minutos. Gana el equipo que haya aportado el máximo valor y satisfacción de las expectativas del cliente en el mínimo tiempo.\r\n\r\n### Roles en el juego\r\n \r\n 1. Facilitador(es) del juego: explican las reglas, cronometran los tiempos de las actividades y actúan como Scrum Masters.\r\n 2. Cliente(s) / Product Owners.\r\n 3. Equipos de 5 a 7 personas.\r\n\r\n\r\n### Actividades del juego\r\n\r\n 1. 30 minutos: priorización de la lista de objetivos (backlog). El cliente la presenta al equipo, quien estima el esfuerzo relativo de cada uno. El cliente prioriza balanceando el valor que aporta cada objetivo respecto a su esfuerzo.\r\n 2. 45 minutos de ejecución del proceso de Scrum en 3 iteraciones, cada una de 15 minutos, con las siguientes actividades:\r\n\r\n\r\n*Definición de completado: el objetivo ha sido construido y preparado para ser entregado al consumidor (no queda nada pendiente respecto a ese objetivo y ya está integrado en el expendedor), documentado (con el detalle adicional proporcionado por el cliente y el que sea necesario para facilitar su futuro mantenimiento) y probado (cumple los requisitos que proporcionó el cliente).\r\n \r\n10 minutos para reflexionar una vez ha finalizado en juego.\r\n\r\n### Lista de objetivos/requisitos (product backlog)\r\n\r\nLos objetivos/requisitos que debe cumplir el expendedor son los siguientes:\r\n\r\n\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
