(120, 'Ejercicios: Diagramas de flujo y pseudocodigo', 16, '2016-02-03 00:37:27', '2016-02-17 04:36:42', 'exercise', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1: SUMA DE DOS NÚMEROS\r\n---------------------\r\n\r\n\r\nEscriba un algoritmo que pregunte por dos números y muestre como resultado la suma de estos. \r\n\r\nUse Pseudocódigo y diagrama de flujo.\r\n\r\n\r\nEjercicio #2: PROMEDIO DE 3 NÚMEROS\r\n---------------------\r\n\r\nEscriba un algoritmo que pregunte por 3 números y muestre como resultado el promedio de estos.\r\n\r\nUse Pseudocódigo y diagrama de flujo.\r\n\r\nEjercicio #3: CÁLCULO AREA DE UN TRIÁNGULO\r\n---------------------\r\n\r\nEscriba un algoritmo que permita conocer el área de un triángulo a partir de la base y la altura. \r\n\r\nExprese el algoritmo usando Pseudocódigo y diagrama de flujo\r\n\r\nEjercicio #4: CÁLCULAR CANTIDAD GALONES DE LECHE\r\n---------------------\r\n\r\nUn productor de leche lleva el registro de lo que produce en litros, pero cuando entrega le pagan en galones.\r\n\r\nRealice un algoritmo, y represéntelo mediante un diagrama de flujo y el pseudocódigo, que ayude al productor a saber cuánto recibirá por la entrega de su producción de un día (1 galón= 3.785 litros).\r\n\r\nEjercicio #5: SUELDO\r\n---------------------\r\n\r\nSe requiere determinar el sueldo semanal de un trabajador con base en las horas que trabaja y el pago por hora que recibe. \r\n\r\nRealice el diagrama de flujo y el pseudocódigo que representen el algoritmo de solución correspondiente\r\n\r\nEjercicio #6: CONVERSION MEDIDAS DE LA TELA\r\n---------------------\r\nUna modista, para realizar sus prendas de vestir, encarga las telas al extranjero.Para cada pedido, tiene que proporcionar las medidas de la tela en pulgadas, pero ella generalmente las tiene en metros. \r\n\r\nRealice un algoritmo para ayudar a resolver el problema, determinando cuántas pulgadas debe pedir con base en los metros que requiere. \r\n\r\nRepreséntelo  mediante el diagrama de flujo y el pseudocódigo (1 pulgada = 0.0254 m).\r\n\r\nEjercicio #7: PINTURAS "LA BROCHA GORDA"\r\n---------------------\r\n\r\nPinturas “La brocha gorda” requiere determinar cuánto cobrar por trabajos de pintura. Considere que se cobra por m2 y realice un diagramade flujo y pseudocódigo que representen el algoritmo que le permita ir generando presupuestos para cada cliente.\r\n\r\nEjercicio #8: AUTOBUSES "LA CURVA LOCA"\r\n---------------------\r\n\r\nLa compañía de autobuses “La curva loca” requiere determinar el costo que tendrá el boleto de un viaje sencillo, esto basado en los kilómetros por recorrer y en el costo por kilómetro. \r\n\r\nRealice un diagrama deflujo y pseudocódigo que representen el algoritmo para tal fin\r\n\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(121, 'Ejercicios: Condicionales simples y condicionales múltiples', 16, '2016-02-03 00:50:50', '2016-02-13 04:15:47', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1: APROBADO O REPROBADO\r\n---------------------\r\nSe pide leer tres notas de un alumno. Obtener su nota en un rango de 1 al 10  y enviar un mensaje donde diga si el alumno aprobó o reprobó el curso (tomar en cuenta que si obtiene 6 o más aprueba, de lo contrario no)\r\n\r\nExprese el algoritmo usando Pseudocódigo y diagrama de flujos \r\n\r\nEjercicio #2:  ¿CUÁL ES EL NÚMERO MAS GRANDE?\r\n---------------------\r\n\r\nSe desea implementar un algoritmo para determinar cuál de dos valores proporcionados es el mayor. \r\n\r\nRepresentarlo con pseudocódigo y diagrama de flujo\r\n\r\nEjercicio #3: POSITIVO O NEGATIVO\r\n---------------------\r\n\r\nRealice un algoritmo para determinar si un número es positivo o negativo.\r\n\r\nRepreséntelo en pseudocódigo y diagrama de flujo\r\n\r\nEjercicio #4: Almacenes “El harapiento distinguido” \r\n---------------------\r\nAlmacenes “El harapiento distinguido” tiene una promoción: a todos los trajes que tienen un precio superior a $2500.00 se les aplicará un descuento de 15 %, a todos los demás se les aplicará sólo 8 %. \r\n\r\nRealice un algoritmo para determinar el precio final que debe pagar una persona por comprar un traje y de cuánto es el descuento que obtendrá. \r\n\r\nRepreséntelo mediante el pseudocódigo, el diagrama de flujo \r\n\r\nEjercicio #5: EL MAYOR DE LOS NÚMEROS\r\n---------------------\r\nSe requiere determinar cuál de tres cantidades proporcionadas es la mayor. \r\n\r\nRealizar su respectivo algoritmo y representarlo mediante un diagrama de flujo y pseudocódigo\r\n\r\nEjercicio #6: BANQUETES “La langosta ahumada”\r\n---------------------\r\n“La langosta ahumada” es una empresa dedicada a ofrecer banquetes; sus tarifas son las siguientes: el costo de platillo por persona es de $95.00, pero si el número de personas es mayor a 200 pero menor o igual a 300, el costo es de $85.00. Para más de 300 personas el costo por platillo es de $75.00. \r\n\r\nSe requiere un algoritmo que ayude a determinar el presupuesto que se debe presentar a los clientes que deseen realizar un evento. Mediante pseudocódigo y diagrama de flujo represente su solución.\r\n\r\nEjercicio #7: VIAJE ESCOLAR\r\n---------------------\r\n\r\nEl director de una escuela está organizando un viaje de estudios, y requiere determinar cuánto debe cobrar a cada alumno y cuánto debe pagar a la compañía de viajes por el servicio. La forma de cobrar es la siguiente: si son 100 alumnos o más, el costo por cada alumno es de $65.00; de 50 a 99 alumnos, el costo es de $70.00, de 30 a 49, de $95.00, y si son menos de 30, el costo de la renta del autobús es de $4000.00, sin importar el número de alumnos.\r\n\r\nRealice un algoritmo que permita determinar el pago a la compañía de autobuses y lo que debe pagar cada alumno por el viaje (represente en pseudocódigo y diagrama de flujo)\r\n\r\nEjercicio #8: COMPAÑIA DE AUTOBUSES\r\n---------------------\r\n\r\nUna compañía de viajes cuenta con tres tipos de autobuses (A, B y C), cada uno tiene un precio por kilómetro recorrido por persona, los costos respectivos son $2.0, $2.5 y $3.0. \r\n\r\nSe requiere determinar el costo total y por persona del viaje considerando que cuando éste se presupuesta debe haber un mínimo de 20 personas, de lo contrario el cobro se realiza con base en este número límite\r\n\r\nEjercicio #9: HAMBURGUESAS “El náufrago satisfecho”\r\n---------------------\r\n\r\n“El náufrago satisfecho” ofrece hamburguesas sencillas, dobles y triples, las cuales tienen un costo de $20.00, $25.00 y $28.00 respectivamente. La empresa acepta tarjetas de crédito con un cargo de 5 % sobre la compra.\r\nSuponiendo que los clientes adquieren sólo un tipo de hamburguesa, realice un algoritmo para determinar cuánto debe pagar una persona por N hamburguesas. \r\n\r\nRepreséntelo mediante diagrama de flujo y  pseudocódigo \r\n\r\nEjercicio #10: FABRICAS "EL COMETA"\r\n---------------------\r\n\r\nFábricas “El cometa” produce artículos con claves (1, 2, 3, 4, 5 y 6). Se requiere un algoritmo para calcular los precios de venta, para esto hay que considerar lo siguiente:\r\n\r\n - Costo de producción = materia prima + mano de obra + gastos de fabricación.\r\n - Precio de venta = costo de producción + 45 % de costo de producción.\r\n\r\nEl costo de la mano de obra se obtiene de la siguiente forma: \r\n\r\npara los productos con clave 3 o 4 se carga 75 % del costo de la materia prima;\r\npara los que tienen clave 1 y 5 se carga 80 %, \r\ny para los que tienen clave 2 o 6, 85 %.\r\n\r\nPara calcular el gasto de fabricación se considera lo siguiente:\r\n\r\n - Si el artículo que se va a producir tiene claves 2 o 5, este gasto representa 30 % sobre el costo de la materia prima;\r\n - Si las claves son 3 o 6, representa 35 %; \r\n - Si las claves son 1 o 4, representa 28 %.\r\n\r\nLa materia prima tiene el mismo costo para cualquier clave.\r\n\r\nRepresente mediante el diagrama de flujo y el pseudocódigo', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(122, 'Ejercicio: estructuras repetitivas For, While, do While', 16, '2016-02-03 01:05:03', '2016-02-17 22:21:26', 'exercise', 7, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1: \r\n---------------------\r\nSe requiere un algoritmo para obtener la suma de diez cantidades mediante la utilización de un ciclo **“WHILE”.** \r\n\r\nRealice el diagrama de flujo y el pseudocódigo \r\n\r\nEjercicio #2: \r\n---------------------\r\n\r\nSe requiere un algoritmo para obtener la suma de diez cantidades mediante la utilización de un ciclo **DO...WHILE.**\r\n\r\nRealice el diagrama de flujo y el pseudocódigo\r\n\r\n\r\nEjercicio #3: \r\n---------------------\r\nSe requiere un algoritmo para obtener la suma de diez cantidades mediante la utilización de un ciclo **FOR**. \r\n\r\nRealice el diagrama de flujo, el pseudocódigo\r\n\r\nEjercicio #4: \r\n---------------------\r\nSe requiere un algoritmo para obtener la edad promedio de un grupo de ''N'' alumnos. \r\n\r\nRealice el diagrama de flujo Y el pseudocódigo para representarlo, **utilizando los tres tipos de estructuras de ciclo**\r\n\r\n\r\n\r\n\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(123, 'Hackathon: Proyecto Sentient', 21, '2016-02-04 12:53:02', '2016-03-10 08:14:17', 'exercise', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Sentient.zip', 'application/x-zip-compressed', 6864217, '2016-02-04 12:53:02', '\r\n### INSTRUCCIONES\r\n\r\nEl webshop de laboratoria nos ha encargado realizar un proyecto para un cliente real, el proyecto consiste de un landing page de 3 hojas que muestra la información básica del cliente y de su compañia. \r\n\r\nNosotros como laboratoria educación hemos aceptado el reto y vamos realizar este proyecto en grupos de 2 persona para proponer la mejor solución \r\n\r\n 1. Formar grupos de 2 y comunicarlo a los evaluadores para quede el registro de quien está trabajando con quien. \r\n 2. Descargar el archivo adjunto, tomarse un tiempo para entender lo que se necesite (hacer las consultas del caso necesario para entender todas las aristas del problema)\r\n 3. Una de las integrantes crea un repositorio en github e invita a su compañera a colaborar (los colaboradores se agregan en settings)\r\n 4. La integrante que creo el repositorio sube la primera versión (lo que se entregó en el zip) para que su compañera pueda hacer git pull (descargar los cambios)\r\n 5. Ahora sí a desarrollar, dividan bien el trabajo y midan sus tiempos\r\n 6. Una vez terminado el proyecto se hará una presentación frente a un jurado que representará al cliente y que medirá que tan bien le venden el website\r\n\r\n\r\n ', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
