(125, 'Sintaxis básica:  Estructuras condicionales y repetitivas', 17, '2016-02-11 02:09:31', '2016-02-22 20:11:22', 'slides', 6, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, 'https://docs.google.com/presentation/d/1OwJsFfsBuIFsXWG_zLyF8_4_9XZhrgnFdGXx1FZXoDI/embed?start=false&loop=false&delayms=6000', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(126, 'Ejercicios: estructuras condicionales y repetitivas en Javascript', 17, '2016-02-11 02:11:37', '2016-02-23 03:05:36', 'exercise', 7, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1 Freecodecamp: ESTRUCTURAS\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Inicia sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Basic Javascript"\r\n - Resolver los ejercicios:\r\n\r\n**Desde "Understanding Boolean Values" hasta el de "Counting Cards"\r\nDesde "Iterate with JavaScript For Loops" hasta el de "Profile Lookup"**\r\n\r\nEjercicio #2  ESTRUCTURA CONDICIONAL\r\n---------------------\r\n\r\nCompletar las condiciones de los if del siguiente script para que los mensajes de los alert() se muestren siempre de forma correcta:\r\n\r\n*var numero1 = 5;\r\nvar numero2 = 8;*\r\n\r\n<code>   if(...){\r\n	alert("numero1 no es mayor que numero2");\r\n}\r\nif(...){\r\n	alert("numero2 es positivo");\r\n}\r\nif(...){\r\n	alert("numero1 es negativo o distinto de cero");\r\n}\r\nif(...){\r\n	alert("Incrementar en 1 unidad el valor de numero1 no lo hace mayor o igual que numero2");\r\n}</code>\r\n\r\nEjercicio #3  LOOPS\r\n---------------------\r\n\r\nEl factorial de un número entero *n* es una operación matemática que consiste en multiplicar todos los factores *n x (n-1) x (n-2) x ... x 1.* \r\nAsí, el factorial de 5 (escrito como 5!) es igual a: *5! = 5 x 4 x 3 x 2 x 1 = 120*\r\n\r\n\r\nUtilizando la estructura **for**, crear un script que calcule el factorial de un número entero.\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(127, 'Sintaxis básica: Objetos', 17, '2016-02-11 02:12:11', '2016-02-22 20:12:12', 'slides', 10, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, 'https://docs.google.com/presentation/d/1Sgsk7kfe-gPsT6TztPk7ouxWOFBHysAXkuQ57tACN0Y/embed?start=false&loop=false&delayms=6000', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(129, 'Ejercicio de Objetos', 17, '2016-02-11 02:14:49', '2016-02-23 02:06:57', 'exercise', 12, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1 Freecodecamp: OBJETOS\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Inicia sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Basic Javascript"\r\n - Resolver los ejercicios: **"Build JavaScript Objects" hasta el de "Testing Objects for Properties"**\r\n\r\nEjercicio #2 Freecodecamp: Object Oriented and Functional Programming\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Inicia sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Object Oriented and Functional Programming"\r\n - Resolver los ejercicios: **"Declare JavaScript Objects as Variables" hasta el de "Join Strings with .join"**\r\n\r\n\r\nEjercicio #3 Lista de precios sin IVA\r\n---------------------\r\n\r\nCrea un arreglo “precios” aumentándole el valor del IVA (16%) a los elementos del arreglo “valorDeVenta” \r\n\r\n    var valorDeVenta = [20, 14, 24, 20, 15, 25, 40, 25, 13, 8, 5.4, 10, 11]\r\n\r\nEjercicio #4 Coders\r\n---------------------\r\n\r\nDado el siguiente fragmento de código, hacer lo que se pide:\r\n\r\n    var coders = [\r\n    {\r\n        nombre: "Julia",\r\n        ciudad:"Lima",\r\n        email:"julia@lima.la",\r\n        edad:24\r\n    },\r\n    {\r\n        nombre:"Constanza",\r\n        ciudad:"Santiago",\r\n        email:"constanza@santiago.la",\r\n        edad:19\r\n    },\r\n    {\r\n        nombre:"Claudia",\r\n        ciudad:"Mexico",\r\n        email:"caudia@mexico.la",\r\n        edad:17\r\n    },\r\n    {\r\n        nombre:"Juana",\r\n        ciudad:"Arequipa",\r\n        email:"juana@arequipa.la",\r\n        edad:21\r\n    }]\r\n\r\n **1. Encuentra el mail de una coder:\r\n 2. Agrega dos coders nuevas al arreglo “coders”. Una al principio del arreglo y otra al final del arreglo.\r\n 3. Escribe una función en la que el usuario ingrese el nombre de una coder y le devuelva el email de esa coder.\r\n 4. Ayer fue el cumpleaños de Constanza, actualiza su edad.\r\n 5. Por favor, corrige el mail de Claudia.**\r\n\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(130, 'Examen Grupal: Primes Themes', 21, '2016-02-12 15:06:35', '2016-02-12 15:13:04', 'exercise', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '\r\n### Instrucciones\r\n\r\nEl siguiente es un examen que es grupal (2 personas) y busca medir el nivel alcanzado durante la Unidad 1. \r\n\r\nSe pide realizar el siguiente website:\r\n\r\n![Primes Themes][1]\r\n\r\n![Primes Themes Responsive][2]\r\n\r\n\r\n### Zip para descargar\r\n\r\n[Primes themes][3]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/primes-desktop-design.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/primes-responsive-design.png\r\n  [3]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/examen/Primes.zip', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
