(132, 'Examen Individual: The Gentleman', 21, '2016-02-16 14:44:51', '2016-02-16 15:02:17', 'exercise', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '\r\n### Instrucciones\r\n\r\nThe gentleman es un website para demostrar cuanto han aprendido en esta unidad, por lo que deben aplicar todos sus conocimientos para desarrollarlo. No es necesario hacerlo responsive, se puede usar cualquier framework.\r\n\r\nDescargar el material aqui\r\n\r\n[The Gentleman][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/gentleman.zip', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(133, 'Examen Individual: Fashion Accesories', 24, '2016-02-16 21:01:12', '2016-03-10 08:21:58', 'exercise', 0, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Fashion-Accesories.zip', 'application/zip', 5856455, '2016-02-25 17:04:08', '\r\n### INSTRUCCIONES\r\n\r\nEl siguiente es un examen es individual y busca medir el nivel alcanzado en los temas de Sass y Jade de la Unidad 2.\r\nEL tiempo estimado a realizar es de 4 horas.\r\n\r\nSe pide realizar el siguiente website ( home e interna )\r\n\r\n![enter image description here][1]\r\n![enter image description here][2]\r\n\r\n\r\n  [1]: http://i.imgur.com/uCx3I0d.png\r\n  [2]: http://i.imgur.com/XJq8nkj.png', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(134, 'Examen Grupal: La Republica', 24, '2016-02-16 21:08:17', '2016-03-10 08:22:17', 'exercise', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'La-Republica-Examen.zip', 'application/zip', 30889556, '2016-02-23 16:26:34', '\r\n### INSTRUCCIONES\r\n\r\nEl siguiente es un examen que es grupal (3 personas) y busca medir el nivel alcanzado en los temas de SASS y Jade durante la Unidad 2.\r\n\r\nEL tiempo estimado para entregar el examen es de 3 días\r\n\r\nA cada grupo se le entregarán 6 pantallas que pertenecen al rediseño del sitio web del diario La Republica. Las pantallas se encuentran dentro de la carpeta **docs**\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: http://i.imgur.com/wUu8qwm.jpg', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(135, 'Ejercicios prácticos', 16, '2016-02-17 22:23:09', '2016-02-17 22:56:10', 'exercise', 8, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1: \r\n---------------------\r\n\r\nSe requiere un algoritmo para obtener la estatura promedio de un grupo de personas, cuyo número de miembros se desconoce, el ciclo debe efectuarse siempre y cuando se tenga una estatura registrada. \r\n\r\nRealice el diagrama de flujo y el pseudocódigo **utilizando el ciclo apropiado**\r\n\r\nEjercicio #2: \r\n---------------------\r\n\r\nSe requiere un algoritmo para determinar, de N cantidades, cuántas son menores o iguales a cero y cuántas mayores a cero. \r\nRealice el diagrama de flujo y  el pseudocódigo para representarlo, **utilizando el ciclo apropiado.**\r\n\r\nEjercicio #3: \r\n---------------------\r\n\r\nRealice un algoritmo para generar N elementos de la sucesión de Fibonacci (0, 1, 1, 2, 3, 5, 8, 13,…). \r\n\r\nRealice el diagrama de flujo y el pseudocódigo para representarlo, **utilizando el ciclo apropiado.**\r\n\r\nEjercicio #4: \r\n---------------------\r\n\r\nUna persona se encuentra en el kilómetro 70 de la carretera AguascalientesZacatecas, otra se encuentra en el km 150 de la misma carretera. La primera viaja en dirección a Zacatecas, mientras que la segunda se dirige a Aguascalientes,\r\na la misma velocidad. \r\n\r\nRealice un algoritmo para determinar en qué kilometro de esa carretera se encontrarán y represéntelo mediante el diagrama de flujo y el pseudocódigo **utilizando el ciclo apropiado.**', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
(136, 'Ejercicios: Tipos de datos, variables y operadores', 17, '2016-02-18 00:18:42', '2016-02-23 02:12:41', 'exercise', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1 Freecodecamp: TIPOS DE DATOS, VARIABLES Y OPERADORES\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Crear una cuenta e iniciar sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Basic Javascript"\r\n - Resolver los ejercicios desde "Comment your JavaScript" hasta el de "Word Blanks"\r\n\r\nEjercicio #2 : OPERADORES\r\n---------------------\r\nA partir del siguiente array que se proporciona: \r\n\r\n    var valores = [true, 5, false, "hola", "adios", 2];\r\n\r\n **1. Determinar cuál de los dos elementos de texto es mayor\r\n 2. Utilizando exclusivamente los dos valores booleanos del array, determinar los operadores necesarios para obtener un resultado true y otro resultado false\r\n 3. Determinar el resultado de las cinco operaciones matemáticas realizadas con los dos elementos numéricos**\r\n', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
