(138, 'Ejercicio: Arreglos', 17, '2016-02-18 00:22:31', '2016-02-23 02:15:25', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1 Freecodecamp: ARRAYS\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Iniciar sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Basic Javascript"\r\n - Resolver los ejercicios desde "Store Multiple Values in one Variable using JavaScript " hasta el de "Shopping List"\r\n\r\nEjercicio #2: ARRAYS\r\n---------------------\r\n\r\nCrear un array llamado *meses* y que almacene el nombre de los doce meses del año. \r\nMostrar por pantalla los doce nombres utilizando la función *alert()*', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
