(141, 'Ejercicios: Funciones', 17, '2016-02-18 01:50:47', '2016-02-23 03:15:05', 'exercise', 9, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1 Freecodecamp: FUNCIONES\r\n---------------------\r\n\r\n - Ingresar a http://freecodecamp.com/\r\n - Inicia sesión\r\n - Ir al apartado donde dice “Map”\r\n - Buscar los ejercicios de "Basic Javascript"\r\n - Resolver los ejercicios: **Desde "Write Reusable JavaScript with Functions" hasta el de "Stand in Line"**\r\n\r\nEjercicio #2: FUNCIONES\r\n---------------------\r\n\r\n 1. Define una función el maximoDeDosNumeros que toma dos números como argumentos y devuelve el mayor de ellos. Usa condicionales (if-then-else).\r\n 2. Define una función el maximoDeTresNumeros que toma tres números como argumentos y devuelve el mayor de ellos.\r\n 3. Escribe una función que tome un carácter y devuelva verdadero si es una vocal y falso si no es.\r\n\r\n\r\nEjercicio #3: FUNCIONES\r\n---------------------\r\n\r\n 1. Escribe una función que suma todos los dígitos en un array y otra que multiplique todos los números de otra array.\r\n 2. Escribe una función que tome un string y lo devuelva reverso.\r\n 3. Escribe una función que tome como argumento una palabra y devuelva la palabra escrita en reversa. \r\n 4. Escribe una función que tome como argumento un array de palabras y devuelva la que tiene mayor longitud.', 0, '', NULL, NULL, NULL, NULL, 0, 0, 0, NULL),
